<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <link rel="stylesheet" href="styles.css">
  <title>Fetsy Proxy Server</title>
</head>
<body>
  <div id="wrapper">
    <div id="header">
      <img src="https://festy-images.s3.us-west-1.amazonaws.com/header.png">
    </div>
    <div id="top">
      <div id="topLeft">
        <div id="images"></div>
        <div id="reviews"></div>
      </div>
      <div id="topRight">
        <div id="shopping"></div>
        <div id="descriptionShipping">
          <img src="https://festy-images.s3.us-west-1.amazonaws.com/descriptionShipping.png">
        </div>
      </div>
    </div>
    <div id="bottom">
      <div id="seller"></div>
      <div id="moreItems">
        <img src="https://festy-images.s3.us-west-1.amazonaws.com/moreItems.png">
      </div>
    </div>
    <div id="footer">
      <img src="https://festy-images.s3.us-west-1.amazonaws.com/footer.png">
    </div>
  </div>
  <script src="/shopping"></script>
  <script src="/reviews"></script>
  <script src="/seller"></script>
  <script src="/images"></script>
</body>
</html>
